import "./mealItem.css"

function MealItem(props)
{
    return(
        <div className="box">
            <div>
            <h3>
                {props.item.name}
            </h3>
            <p className="description">
                {props.item.description}
            </p>
            </div>
            <h2 className="price">
                ${props.item.price.toString()}
            </h2>
        </div>
    )
}

export default MealItem;
